import "./custom-button.scss";

import React from "react";

function CustomButton({ children, isGoogleSignIn, inverted, ...restProps }) {
    return (
        <button
            className={`${inverted ? "inverted" : ""} ${
                isGoogleSignIn ? "google-sign-in" : ""
            } custom-button`}
            {...restProps}
        >
            {children}
        </button>
    );
}

export default CustomButton;
